import React, { Component } from "react";
import API from "../utils/API";
import Container from "../components/Container";
import QueryForm from "../components/QueryForm"


function Query(){
    return (
        <div>    
            <Container style={{ marginTop: 30 }}>

                <Row>
                    <Col size="md-12">
                        <QueryForm />
                    </Col>
                </Row>

            </Container>
        </div>
    )
}

export default Query;
